          id: 'Q7OmChd',
          title: null,
          description:
            'The 4 of us could barely make a dent in it. Yes, there is ice in that wine glass. Yes, I’m a heathen.\n\nIngredients:\n1 onion\n4 cloves of garlic\n2 chicken breasts marinated in smoked paprika, garlic, salt, and olive oil\n1 pack of chorizo sausage\n1 pack of smoked Turkey kielbasa \n3 cups of Bomba rice\n6 cups chicken stock\n1 large can of diced tomatoes\n1 bunch of asparagus\n1 red bell pepper\n1 cup of white wine\nSalt and pepper\nPinch of saffron (soak it to bring out color)\nEnough beer to keep you happy while it cooks on the grill.\nA dog to keep you company.\nSome good music keep the vibe going.\nFork and spoon\nYou can add any protein you like. It normally contains seafood as well, by my kids are lame. Add mussels, clams, shrimp, calamari, etc.\n\nEdit: to those of you who are offended by my use of specific ingredients. Get over it. I searched for the closest ingredients I could find to the paella I had recently in Spain. Yes, I know “traditional” paella has rabbit. I also have a little girl at home who would never forgive me if I included it, a wife who hates seafood, and it was my first time. Rather than rip someone apart, how about either giving someone a thumbs up for trying, or moving along, you can’t have any of my tasty creation. The internet is really lame sometimes. To the rest of you, you’re all invited to come next time.',
