            "I've been in the Restaurant industry since 2007. Have worked with some great people, hated some people. Drank a ton. Been sober almost two years.\n\nI said when I was 32 that by 35 I'd be out and somewhere else. COVID happened and with everyone looking for jobs in 2020 I fell back on cooking since I needed a job at the time.\n\nI recently came into some money that after things at work took a toxic turn for the worse, I started weighing my options.\n\nI normally wait to have a new job lined up before quitting a job but it's just gotten so bad imo that I need out, so I did. Finish up Friday. I just got paid, get one more cheque, get a fat stack in tips and then savings to fall on. \n\nI'm not going to just not apply for jobs and I do have a few apps out there as we speak but the time off for a bit would be nice to re-energize.\n\nI'm looking to change careers to anything really and look forward to the challenges. If things start looking dire, I'll take a cook job and try again next Summer.\n\nThanks for reading. Hope everyone is well.\n\n.\nTL;DR Quit my job, looking to change careers, scared for the future but excited as well.",
